
--EXEC	[dbo].[CreatePracticeReportData] 58,3,3,N'<Dr.> <Name> is unusually self-confident, and needs to be reminded periodically to listen to negative feedback, to pay attention to <his> inevitable mistakes in order to learn from them, and to understand that others may be stressed when <he> is not.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 59,3,3,N'<Dr.> <Name> has a strong achievement drive, is keenly interested in opportunities for advancement, and is likely to move on if opportunities are not forthcoming. <He> needs to be reminded not to intimidate inexperienced or more junior colleagues, to practice letting others be in charge, and to be patient with others who are less motivated than <he> seems to be.',N'en-US',1,3
---EXEC	[dbo].[CreatePracticeReportData] 60,3,3,N'<Dr.> <Name> is so outgoing and socially self-confident that <he> may need to be reminded to listen to others and not to interrupt them. <He> also needs to prepare for public performances, not shoot from the hip, and share credit for successes. ',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 61,3,3,N'<Dr.> <Name> is unusually eager to please, and <he> will tend to avoid confrontations and disagreement; consequently, <he> needs to be reminded to be careful not to promise more than <he> can deliver, to be consistent in enforcing rules, and to confront problems promptly. ',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 62,3,3,N'<Dr.> <Name> is very conscientious, and needs to be reminded not to try to do everything <himself> and not to try to do every job equally well. <He> should learn how to delegate and prioritize <his> work, and be sure to be flexible when asked for favors. ',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 63,3,3,N'<Dr.> <Name> is curious and imaginative, and may be easily bored with routine tasks; <he> will thrive in problem solving situations and should be reminded to stay with tasks until they are finished.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 64,3,3,N'<Dr.> <Name> is bright and well-informed, interested in opportunities to learn, and may be unhappy when they are not available. In addition, <he> will respond positively to performance goals because <he> is so achievement driven. ',N'en-US',1,3



--EXEC	[dbo].[CreatePracticeReportData] 58,2,3,N'<Dr.> <Name> is reasonably self-satisfied and, as a result should solicit feedback from his team and pay attention. <He> should be reminded to contribute appropriately to team efforts, and to understand that others may feel stressed when <he> doesn''t.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 59,2,3,N'<Dr.> <Name> needs to be reminded to step up to the challenges and take initiative. <He> may also need to be reminded to be persistent and results-oriented when working on tasks. <He> should look for opportunities to increase leadership while supporting <his> colleagues in both word and deed.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 60,2,3,N'<Dr.> <Name> should be encouraged to talk with <his> colleagues and ask their advice. <He> should be sure to make <his> opinions known during meetings.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 61,2,3,N'<Dr.> <Name> should learn to anticipate other''s expectations and respect their needs. <He> should be reminded to be patient when others make mistakes, typically when they will not deliberately make errors.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 62,2,3,N'<Dr.> <Name> should be reminded to stay flexible in ambiguous situations. <He> should remember that <he> may never have all the information needed to make decision. <He> should prioritize <his> work, keeping in mind that not every task requires equal effort or attention. ',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 63,2,3,N'<Dr.> <Name> should be reminded to think and talk about vision or strategy. <He> should also understand the importance of innovation and support it when possible.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 64,2,3,N'<Dr.> <Name> should develop a plan for self-improvement and to check <his> progress periodically. <He> should be encouraged to stay current in <his> field and to be alert for opportunities to develop new skills and competencies.',N'en-US',1,3


--EXEC	[dbo].[CreatePracticeReportData] 58,1,3,N'Although this person may seem self-confident, <Dr.> <Name> tends to be defensive and to take things personally. <He> needs to take things more lightly and practice stress management. <He> should be reassured that performance feedback is a good thing and the key to personal development.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 59,1,3,N'<Dr.> <Name> tends to avoid taking charge. For development, <he> should consider training in assertiveness and/or public speaking to enhance <his> leadership skills and willingness to take initiative. ',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 60,1,3,N'<Dr.> <Name> tends to be shy and introverted, consequently <he> needs to increase <his> interaction and talk with his colleagues more everyday; this is especially important for managerial responisbility. Moreover, <he> should speak up at meetings and not wait to be asked for <his> opinion.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 61,1,3,N'<Dr.> <Name> tends to be independent, focused on <his> own agenda, and indifferent to others'' feelings. When someone challenges this agenda, <his> first impulse is to confront the person directly. <He> needs to be patient and try to understand the other person''s perspective.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 62,1,3,N'<Dr.> <Name> is somewhat impulsive, and should make a list each day of the things <he> needs to get done, paying special attention to following up on loose ends and commitments. <He> should make a special effort to complete tedious tasks and be sure to gather enough information before making important decisions.',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 63,1,3,N'<Dr.> <Name> needs to be encouraged to think and talk about the big picture, the vision and the overall strategy. <He> may also need to be reminded that innovation and change will help the organization stay competitive. ',N'en-US',1,3
--EXEC	[dbo].[CreatePracticeReportData] 64,1,3,N'<Dr.> <Name> may not be interested in education, and should, therefore make efforts to read, to take advantage of training opportunities, to help others do the same, and to think about the practical applications of training. <He> may also need to set specific goals for new learning.',N'en-US',1,3




